0022long\u0022: \u0022\u002D97.65466565734482\u0022}, {\u0022first\u0022: \u0022Keren\u0022, \u0022last\u0022: \u0022Carlson\u0022, \u0022address\u0022: \u00222045 Holdredge Rd NE 68423\u0022, \u0022lat\u0022: \u002240.828634309676616\u0022, \u0022long\u0022: \u0022\u002D96.99948492886335\u0022}, {\u0022first\u0022: \u0022                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               \u0022, \u0022last\u0022: null, \u0022address\u0022: null, \u0022lat\u0022: null, \u0022long\u0022: null}]";
			    houses = JSON.parse(houses);			
			    
			    

			var markers=[];

				function initMap() {
				var loaded_map = false;
				for(var i=0;i<houses.length;i++){
				  var p = houses[i];
				  
				  const position = { lat: parseFloat(p.lat), lng: parseFloat(p.long) };
				  if(!loaded_map){
					  map = new google.maps.Map(document.getElementById("map"), {
					    center: position,
					    zoom: 11	
					  });

					  map.addListener('zoom_changed', function() {
					    
					    if (map.zoom >= 18) {
					    	for(var i=0;i<markers.length;i++){
					    		markers[i].icon.scaledSize = new google.maps.Size(32,32);
						      	markers[i].icon.size = new google.maps.Size(32, 32);
						      	markers[i].icon.labelOrigin = new google.maps.Point(15, 10);
						      	markers[i].setMap(map);
					    	}
					      
					    }

					    if (map.zoom <= 17) {
					    	for(var i=0;i<markers.length;i++){
					      //restore to original size upon specific zoom
					      markers[i].icon.scaledSize = new google.maps.Size(32, 32);
					      markers[i].icon.size = new google.maps.Size(32, 32);
					      markers[i].icon.labelOrigin = new google.maps.Point(15,10)
					      markers[i].setMap(map);
					    	}

					    }
					  });
					  loaded_map = true;
					}
				  // The marker, positioned at Uluru
				  const marker = new google.maps.Marker({
				    position: position,
				    map: map,
				    label: {
				    	text: ""+(i+1),
				    	fontSize: "0.8em",
				    },

					icon: {
				      url: "http://maps.google.com/mapfiles/kml/paddle/red-blank.png",
				      labelOrigin: new google.maps.Point(35,20)
				  	}
				  });

				  markers.push(marker)
				  
				  const infowindow = new google.maps.InfoWindow({
				    content: "<div style='font-size:1.8em;'><strong>H#"+(i+1)+":</strong><br/>" +p.address +"<br/><br/>"+p.first+" " + p.last+"</div>",
				  });
				  marker.addListener("click", () => {
				  	if(info_w!=null){
				  		info_w.close();
				  	}
				    infowindow.open({
				      anchor: marker,
				      map,
				      shouldFocus: false,
				    });
				    info_w = infowindow
				  });
				}
			}
		</script>

    <script

    ></script>
